import React from "react";
import "./style.css";

// component: Footer 레이아웃 //
export default function Footer() {
  // event handler: 인스타 아이콘 버튼 클릭 이벤트 처리 //
  const onInstaIconButtonClickHandler = () => {
    window.open("https://www.instagram.com");
  };

  // event handler: 인스타 아이콘 버튼 클릭 이벤트 처리 //
  const onNaverBlogIconButtonClickHandler = () => {
    window.open("https://www.blog.naver.com");
  };

  // render: Footer 레이아웃 렌더링 //
  return (
    <div id="footer">
      <div className="footer-container">
        <div className="footer-top">
          <div className="footer-logo-box">
            <div className="icon-box">
              <div className="icon logo-light-icon"></div>
            </div>
            <div className="footer-logo-text">{"Play Fit"}</div>
          </div>
          <div className="footer-link-box">
            <div className="footer-email-link">{"email@email.com"}</div>
            <div className="icon-button">
              <div className="icon insta-icon"></div>
            </div>
            <div className="icon-button">
              <div className="icon naver-blog-icon"></div>
            </div>
          </div>
        </div>
        <div className="footer-bottom">
          <div className="footer-copyright">
            {"Copyright © 2024 PlayFit. All Rights Reserved."}
          </div>
        </div>
      </div>
    </div>
  );
}
